import React from 'react';
import Hero from '../Hero';

import Banner from '../Banner';
import { Link } from 'react-router-dom';

const Room = () => {
  return (
    <Hero hero='roomsHero'>
      <Banner title='Our Rooms' subtitle='page not found'>
        <Link to='/' className='btn-primary'>
          return home
        </Link>
      </Banner>
    </Hero>
  );
};

export default Room;
